          authors: ['William Douglas Heaven'],
          description:
            'Cuando el covid-19 golpe√≥ Europa en marzo de 2020, los hospitales se sumieron en una crisis sanitaria que a√∫n se entend√≠a mal. ‚ÄúLos m√©dicos realmente no ten√≠an idea de c√≥mo manejar a estos pacientes‚Äù, dice Laure Wyn',
