          source_domain: 'technologyreview.com',
          submitters: ['Anonymous'],
          title: 'Cientos de herramientas de IA se han creado para detectar el covid. Ninguna de ellas ayud√≥.',
          name: 'Cientos de herramientas de IA se han creado para detectar el covid. Ninguna de ellas ayud√≥.',
          url: 'https://www.technologyreview.com/2021/07/30/1030329/machine-learning-ai-failed-covid-hospital-diagnosis-pandemic/',
          tags: [],
